import React from 'react';
import { DatePicker } from 'antd';
import './App.scss';

function App() {
  return (

    <div className="app">
      <h1>Web Personal - Client <span>Jon Oxker</span></h1>
      <h2>Proyecto</h2>

      ReactDOM.render(
        <>
          <DatePicker  />
        </>,
        mountNode,
      );
    </div>
  );
}

export default App;
